webpackJsonp([0x59fc650ad028e00],{"./node_modules/json-loader/index.js!./.cache/json/miscellaneous-how-to-reach-free-code-camp-team-for-interviews.json":function(e,t){e.exports={data:{markdownRemark:{html:"<p>We’re happy to do a quick interview for your publication or show. Here’s whom you should contact about what, and how to best reach them:</p>\n<ul>\n<li>Want to talk to about Free Code Camp’s curriculum or long-term vision? Reach out to Quincy Larson. He’s <a href='https://twitter.com/ossia' target='_blank' rel='nofollow'>@ossia on Twitter</a> and <a href=\"/users/quincylarson\">@quincylarson</a> on Gitter.</li>\n<li>Want to talk about Free Code Camp’s open source codebase, infrastructure, or JavaScript in general? Talk to Berkeley Martinez. He’s <a href='https://twitter.com/berkeleytrue' target='_blank' rel='nofollow'>@berkeleytrue on Twitter</a> and <a href=\"/users/berkeleytrue\">@berkeleytrue</a> on Gitter.</li>\n<li>Want to explore our efforts to empower nonprofits with code? Michael D. Johnson eats, sleeps and breathes that. He’s <a href='https://twitter.com/codenonprofit' target='_blank' rel='nofollow'>@codenonprofit on Twitter</a> and <a href=\"/users/codenonprofit\">@codenonprofit</a> on Gitter.</li>\n<li>Want to get a camper’s perspective on our community? Talk with Bianca Mihai. She’s <a href='https://twitter.com/bubuslubu' target='_blank' rel='nofollow'>@bubuslubu on Twitter</a> and <a href=\"/users/biancamihai\">@biancamihai</a> on Gitter. Or you can talk with Suzanne Atkinson. She’s <a href='https://twitter.com/SteelCityCoach' target='_blank' rel='nofollow'>@steelcitycoach on Twitter</a> and <a href=\"/users/adventurebear\">@adventurebear</a> on Gitter.</li>\n</ul>\n<p>We strive to be helpful and transparent in everything we do. We’ll do what we can to help you share our community with your audience.</p>",fields:{slug:"/miscellaneous/how-to-reach-free-code-camp-team-for-interviews/"},frontmatter:{title:"How to Reach Free Code Camp Team for Interviews"}}},pathContext:{slug:"/miscellaneous/how-to-reach-free-code-camp-team-for-interviews/"}}}});
